import re

def entrance(svgCode: str) -> dict:
    attributes = ['', 'xmlns', 'height', 'viewBox', 'width', 'path']
    attribute_values = {}
    for attribute in attributes:
        match = re.search(f'{attribute}="([^"]+)"', svgCode)
        if match:
            attribute_values[attribute] = match.group(1)
    return attribute_values

